pub enum ResolverFut<R: Host> {
    Resolved(Option<ConnectInfo<R>>),
    LookUp(JoinHandle<io::Result<IntoIter<SocketAddr>>>,
           Option<ConnectInfo<R>>),
    LookupCustom(LocalBoxFuture),
}

pub enum TcpConnectorFut<R> {
    Response {
        req: Option<R>,
        port: u16,
        local_addr: Option<IpAddr>,
        addrs: Option<VecDeque<SocketAddr>>,
        stream: ReusableBoxFuture,
    },
    Error(Option<ConnectError>),
}
